import { Box, Center, Text, VStack } from "@chakra-ui/react"
import React from "react"

export const Home: React.FC = () => {
  return (
    <Box>
      <VStack bg="blue.100" height="60px">
        <Text fontSize="20PX" mt="30px">
          USERS' DASHBOARD
        </Text>
      </VStack>
    </Box>
  )
}
